import { NavLink } from "react-router-dom";

const navItem = [
  {
    pathName: "Home",
    path: "/",
  },
  {
    pathName: "Products",
    path: "/products",
  },
  {
    pathName: "About us",
    path: "/about",
  },
];

const Navbar = () => {
  const navList = navItem.map((item) => (
    <li key={item.path}>
      <NavLink to={item.path}>{item.pathName}</NavLink>
    </li>
  ));

  return(
    <nav>
        <section>
            <h3></h3>
        </section>
        <ul>
            {navList}
        </ul>
    </nav>
  )
};

export default Navbar;
